import './App.css';
import Content from './components/Content';
import Header from './components/Header';
import { BrowserRouter as Router,Route,Switch} from 'react-router-dom';
import Home from './pages/Home';

function App() {
  return (
    <Router>
      <div>
        <Switch>

          <Route path="/">
          < Home />
          </Route>

        </Switch>
      </div>
    </Router>
  );
}

export default App;
